import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faGithub } from "@fortawesome/free-brands-svg-icons";

const githubElement = (
  <FontAwesomeIcon className="footer-icon__github" icon={faGithub} />
);
export const Footer = () => {
  const iconCopyRightElement = (
    <a
      href="https://www.freepik.com/vectors/food"
      title="Food vector created by rawpixel.com - www.freepik.com"
    >
      <img
        alt="app-icon"
        className="header-icon__icon"
        src="https://user-images.githubusercontent.com/71889359/133923788-1e176d98-acda-47ab-9eba-3815e3903ecf.png"
      ></img>
    </a>
  );
  const styleCopyRightElement = (
    <span> Web page's style is copy by burerKing</span>
  );
  return (
    <div>
      {iconCopyRightElement} {styleCopyRightElement} {githubElement}
    </div>
  );
};
